const { echarts } = extend;
data = data || [];
data.sort((a, b) => b.val - a.val)
let xAxisData = [] //data.map(item => item.name)
let seriesData = [] //data.map(item => item.val)
data.forEach(f => {
  xAxisData.push(f.name)
  seriesData.push(f.val)
})
let maxSeriesData = []
const MAX = Math.max(...seriesData)
for (let i = 0; i < seriesData.length; i++) {
  maxSeriesData.push(MAX)
}
let barLinearColors = [
  new echarts.graphic.LinearGradient(0, 1, 1, 1, [
    { offset: 0, color: "#EB3B5A" },
    { offset: 1, color: "#FE9C5A" }
  ]),
  new echarts.graphic.LinearGradient(0, 1, 1, 1, [
    { offset: 0, color: "#FA8231" },
    { offset: 1, color: "#FFD14C" }
  ]),
  new echarts.graphic.LinearGradient(0, 1, 1, 1, [
    { offset: 0, color: "#F7B731" },
    { offset: 1, color: "#FFEE96" }
  ]),
  new echarts.graphic.LinearGradient(0, 1, 1, 1, [
    { offset: 0, color: "#395CFE" },
    { offset: 1, color: "#2EC7CF" }
  ])
]

function rankBarColor(cData) {
  let tempData = []
  cData.forEach((item, index) => {
    tempData.push({
      value: item,
      itemStyle: {
        color: index > 3 ? barLinearColors[3] : barLinearColors[index]
      }
    })
  })
  return tempData
}
